import React from "react";
import { Home } from ".";

export default function Layout() {
	return (
		<div className="w-full h-full flex flex-col items-center justify-center">
			<div className="nave__bar">Nave bar</div>
			<div className="home">
				<Home />
			</div>
			<div className="footer">Footer</div>
		</div>
	);
}
